import React from "react";
import { MDBCard, MDBCardBody, MDBIcon, MDBView, MDBMask,
  MDBContainer, MDBRow, MDBCol, MDBInput, MDBBtn } from 'mdbreact';

const LoginForm = () => {
  return (
    <MDBContainer>
      <MDBRow>
        <MDBCol className="d-flex justify-content-center">
          <form className="white-text">
            <p className="h3 text-center my-5">Sign in</p>
            <div>
              <MDBInput
                label="Your email"
                icon="envelope"
                type="email"
              />
              <MDBInput
                label="Your password"
                icon="lock"
                type="password"
              />
            </div>
            <div className="text-center">
              <MDBBtn>Login</MDBBtn>
            </div>
          </form>
        </MDBCol>
      </MDBRow>
    </MDBContainer>
  );
};

export default LoginForm;
